import Header from "../components/Header";
import styles from "../styles/HomePage.module.css";
export default function HomePage() {
  return (
    <div className={styles.container}>
      <Header />
      <div className={styles.titles}></div>
      <p className={styles.title}>Найкраща піца у вашому місті.</p>
      <p className={styles.title}>Спробуй!</p>
      <img className={styles.pizza_img} src="image.png" alt="pizza_image"></img>
      <img src="image (1).png" alt="leaf" className={styles.leaf_img}></img>
      <div className={styles.infoText}>
        <p>
          Не втрачайте можливість скуштувати нашу унікальну піцу, приготовану з
          найкращих інгредієнтів. Вибирайте свою улюблену піцу та насолоджуйтеся
          неперевершеним смаком!
        </p>
      </div>
      <button className={styles.menu_button}>Переглянути меню</button>
    </div>
  );
}
